pub enum Directive {
    Invert {
            x: Witness,
            result: Witness,
        },
    Quotient {
            a: Expression,
            b: Expression,
            q: Witness,
            r: Witness,
        },
    Truncate {
            a: Witness,
            b: Witness,
            c: Witness,
            bit_size: u32,
        },
    Oddrange {
            a: Witness,
            b: Witness,
            r: Witness,
            bit_size: u32,
        },
    Split {
            a: Witness,
            b: Vec<Witness>,
            bit_size: u32,
        },
}
